import React, { Component } from "react";
import { Chart } from "react-google-charts";

class Graph extends Component {
  state = {};
  render() {
    return (
      <div className={"my-pretty-chart-container"}>
        <Chart
          chartType="ScatterChart"
          data={[
            ["Age", "Weight"],
            [8, 12],
            [4, 5.5],
            [11, 14],
            [4, 5],
            [3, 3.5],
            [6.5, 7]
          ]}
          width="100%"
          height="400px"
          legendToggle
        />
      </div>
    );
  }
}

export default Graph;
